    "2016-07-27T22:48:54.353194",nt"name": "contaminant-survey-of-sunkhaze-stream-and-baker-brook-sunkhaze-meadows-national-wildlife-r-0d6e7",nt"isopen":
    false,nt"url": null,nt"notes": "In 1993 a screening-level contaminant survey
    of the Sunkhaze Meadows National Wildlife Refuge was conducted by the Maine Field
    Office of the U.S. Fish and Wildlife Service. Elevated levels of polychlorinated
    biphenyls (PCBs) were found in a Baker Brook sediment sample (0.78 parts per million,
    ppm) and high chromium levels were found in chain pickerel (10.59 ppm) and yellow
    perch (13.20 ppm) samples from Sunkhaze Stream. In 2001, a followup contaminant
    survey was conducted using additional locations along these watercourses to validate
    the earlier results and to determine the extent of contamination in fish and sediments.
    Between August and September 2001, eighteen wholebody composite fish samples and
    five sediment samples were collected from Sunkhaze Meadows National Wildlife Refuge.
    Four composite samples and one individual sample of wholebody chain pickerel (Esox
    niger), and five composite samples of wholebody yellow perch (Perca flavescens)
    were collected from five stations on Sunkhaze Stream. In Baker Brook, sediments
    samples were collected from five locations. Eight composite samples of wholebody
    brown bullhead (Ameriurus nebulosus) were also collected from four Baker Brook sites
    co- located with sediment collection locations. Bullheads were not available at
    the fifth sediment collection site.",nt"license_title": "License Not Specified",nt"extras":
